import wedding from '../src/Images/IMG_8214.JPG';
import pre_wedding from '../src/Images/IMG_9986.jpg';
import film from '../src/Images/IMG_FILM.JPG';
import maternity from '../src/Images/IMG.jpg';
import product from '../src/Images/IMG_9988.JPG';
import corporate from '../src/Images/IMG_9987.JPG';

const Sdata = [
    {
        imgsrc:wedding,
        
        title:"Wedding"
    },
    {
        imgsrc:pre_wedding,
        
        title:"Pre-Wedding"
    },
    {
        imgsrc:corporate,
        
        title:"Corporate "
    },
    {
        imgsrc:maternity,
        
        title:"Maternity"
    },
    {
        imgsrc:product,
        
        title:"Product"
    },
    {
        imgsrc:film,
        
        title:"Film"
    },
]
export default Sdata
